import React from "react";
import styled from "styled-components";
import IntroImg from "./Task1/assets/IntroBackground.png";

import * as Section from "components/PageSection";

export const Intro = () => (
  <Section.Wrapper>
    <Section.Content>
      <Section.Header>
        <Section.Title>Witaj w Halina Band</Section.Title>
        <Section.Description>
          Halina Band to zespół który powstał z przyjaźni i dla przyjaźni.
        </Section.Description>
      </Section.Header>
      <Section.Image>
        <img src="../assets/IntroBackground.png" alt="HalinaBand Members" />
      </Section.Image>
    </Section.Content>
  </Section.Wrapper>
);
